<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>BEC Equipment Management — Technician Portal</title>
<link href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700;800&family=Nunito:wght@400;600;700;800&display=swap" rel="stylesheet">
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
<style>
:root{
  --maroon:#7B1D1D;--maroon-d:#521010;--maroon-l:#9B2C2C;
  --gold:#D4A017;--gold-l:#F0C040;--gold-p:#FEF9E7;
  --cream:#FFFDF8;--surf:#FFFFFF;--surf2:#FBF7F0;
  --bdr:#EDE0CC;--t1:#1A0A0A;--t2:#6B4040;--t3:#B08080;
  --pb:#FEF9E7;--pc:#92600A;
  --ib:#EBF5FB;--ic:#154360;
  --db:#EAFAF1;--dc:#145A32;
  --rb:#FDEDEC;--rc:#7B241C;
  --ob:#FFF3E0;--oc:#E65100;
  --s1:0 2px 8px rgba(90,16,16,.07);
  --s2:0 6px 24px rgba(90,16,16,.12);
  --s3:0 16px 48px rgba(90,16,16,.16);
  --s3d:0 7px 0 rgba(82,16,16,.2),0 12px 30px rgba(90,16,16,.13);
  --s3dh:0 11px 0 rgba(82,16,16,.24),0 18px 44px rgba(90,16,16,.17);
  --r1:8px;--r2:14px;--r3:20px;--r4:28px;
}
*,*::before,*::after{margin:0;padding:0;box-sizing:border-box;}
html{scroll-behavior:smooth;}
body{font-family:'Nunito',sans-serif;background:var(--cream);color:var(--t1);min-height:100vh;overflow-x:hidden;}
::-webkit-scrollbar{width:5px;}::-webkit-scrollbar-track{background:var(--surf2);}::-webkit-scrollbar-thumb{background:var(--bdr);border-radius:10px;}
.layout{display:flex;min-height:100vh;}

/* ═══ SIDEBAR ═══ */
.sidebar{position:fixed;left:0;top:0;width:260px;height:100vh;background:linear-gradient(180deg,#3D0A0A 0%,var(--maroon-d) 35%,var(--maroon) 100%);display:flex;flex-direction:column;z-index:300;box-shadow:6px 0 32px rgba(52,10,10,.4);transition:transform .35s cubic-bezier(.4,0,.2,1);overflow:hidden;}
.sidebar::before{content:'';position:absolute;inset:0;background:radial-gradient(ellipse 80% 40% at 50% 0%,rgba(212,160,23,.13),transparent);pointer-events:none;}
.sb-seal-area{padding:1.6rem 1.4rem 1rem;border-bottom:1px solid rgba(255,255,255,.07);display:flex;flex-direction:column;align-items:center;gap:.6rem;position:relative;z-index:1;cursor:default;}
.seal-ring{position:relative;width:80px;height:80px;animation:sealFloat 5s ease-in-out infinite;}
@keyframes sealFloat{0%,100%{transform:translateY(0) rotate(0deg);}50%{transform:translateY(-6px) rotate(2deg);}}
.seal-ring::before{content:'';position:absolute;inset:-5px;border-radius:50%;background:conic-gradient(var(--gold),var(--gold-l),var(--gold),var(--gold-l),var(--gold));animation:sealRotate 8s linear infinite;opacity:.7;}
@keyframes sealRotate{from{transform:rotate(0deg);}to{transform:rotate(360deg);}}
.seal-ring::after{content:'';position:absolute;inset:-2px;border-radius:50%;background:var(--maroon-d);}
.seal-img{position:absolute;inset:0;width:100%;height:100%;border-radius:50%;object-fit:cover;border:3px solid rgba(212,160,23,.5);z-index:1;transition:transform .4s;box-shadow:0 0 20px rgba(212,160,23,.3);}
.seal-ring:hover .seal-img{transform:scale(1.06);}
.sb-school-name{text-align:center;line-height:1.25;}
.sb-school-name strong{display:block;font-family:'Poppins',sans-serif;font-size:.82rem;font-weight:800;color:#fff;letter-spacing:.2px;}
.sb-school-name span{font-size:.6rem;color:rgba(255,255,255,.38);text-transform:uppercase;letter-spacing:1.8px;}
.sb-divider{height:1px;margin:0 1.4rem;background:linear-gradient(to right,transparent,rgba(212,160,23,.4),transparent);}
.sb-user{margin:.75rem 1.1rem;background:rgba(255,255,255,.06);border:1px solid rgba(255,255,255,.09);border-radius:var(--r2);padding:.8rem 1rem;display:flex;align-items:center;gap:.7rem;transition:background .2s;cursor:default;position:relative;z-index:1;}
.sb-user:hover{background:rgba(255,255,255,.1);}
.u-av{width:38px;height:38px;flex-shrink:0;background:linear-gradient(135deg,var(--gold),var(--maroon-l));border-radius:50%;display:flex;align-items:center;justify-content:center;font-family:'Poppins',sans-serif;font-weight:800;font-size:.88rem;color:#fff;box-shadow:0 4px 0 rgba(0,0,0,.3),0 6px 14px rgba(0,0,0,.2);transition:transform .25s;}
.sb-user:hover .u-av{transform:scale(1.1) rotate(-5deg);}
.u-name{display:block;font-size:.85rem;color:#fff;font-weight:700;}
.u-meta{display:flex;align-items:center;gap:.3rem;margin-top:.1rem;}
.u-dot{width:6px;height:6px;border-radius:50%;background:#4ade80;box-shadow:0 0 6px #4ade80;animation:uPulse 2s ease-in-out infinite;}
@keyframes uPulse{0%,100%{opacity:1;}50%{opacity:.5;}}
.u-role{font-size:.62rem;color:rgba(255,255,255,.38);text-transform:uppercase;letter-spacing:1.2px;}
.sb-nav{flex:1;padding:.3rem 0;overflow-y:auto;position:relative;z-index:1;}
.sb-nav::-webkit-scrollbar{width:3px;}
.sb-nav::-webkit-scrollbar-thumb{background:rgba(255,255,255,.1);border-radius:3px;}
.nav-sep{font-size:.58rem;text-transform:uppercase;letter-spacing:2.5px;color:rgba(255,255,255,.2);padding:.5rem 1.4rem .2rem;font-weight:700;}
.nav-item{display:flex;align-items:center;gap:.75rem;padding:.6rem 1.4rem;color:rgba(255,255,255,.48);background:none;border:none;width:100%;text-align:left;font-family:'Nunito',sans-serif;font-size:.85rem;font-weight:700;cursor:pointer;transition:all .18s;position:relative;text-decoration:none;}
.nav-item .ni{width:32px;height:32px;border-radius:var(--r1);display:flex;align-items:center;justify-content:center;font-size:.8rem;background:rgba(255,255,255,.06);flex-shrink:0;transition:all .25s;}
.nav-item:hover{color:rgba(255,255,255,.88);}
.nav-item:hover .ni{background:rgba(255,255,255,.12);transform:scale(1.1);}
.nav-item.active{color:#fff;}
.nav-item.active .ni{background:linear-gradient(135deg,var(--gold),var(--gold-l));color:var(--maroon-d);box-shadow:0 3px 0 rgba(0,0,0,.2),0 4px 12px rgba(212,160,23,.3);transform:scale(1.05);}
.nav-item.active::after{content:'';position:absolute;left:0;top:0;bottom:0;width:3px;background:linear-gradient(to bottom,var(--gold),var(--gold-l));border-radius:0 3px 3px 0;}
.n-badge{margin-left:auto;background:linear-gradient(135deg,var(--gold),var(--gold-l));color:var(--maroon-d);font-size:.6rem;font-weight:900;padding:2px 7px;border-radius:20px;box-shadow:0 2px 6px rgba(212,160,23,.4);animation:bPulse 2s ease-in-out infinite;}
@keyframes bPulse{0%,100%{transform:scale(1);}50%{transform:scale(1.1);}}
.sb-foot{padding:.75rem 1.1rem 1.1rem;border-top:1px solid rgba(255,255,255,.07);position:relative;z-index:1;}
.logout-btn{width:100%;display:flex;align-items:center;gap:.7rem;padding:.6rem .9rem;background:rgba(255,255,255,.05);border:1px solid rgba(255,255,255,.07);color:rgba(255,255,255,.48);border-radius:var(--r1);cursor:pointer;font-size:.83rem;font-family:'Nunito',sans-serif;font-weight:700;transition:all .2s;}
.logout-btn:hover{background:rgba(220,38,38,.18);color:#fca5a5;border-color:rgba(220,38,38,.3);}
.logout-btn i{transition:transform .35s;}
.logout-btn:hover i{transform:rotate(180deg);}

/* ═══ MAIN ═══ */
.main{margin-left:260px;min-height:100vh;display:flex;flex-direction:column;}
.topbar{background:var(--surf);border-bottom:1px solid var(--bdr);height:62px;padding:0 2rem;display:flex;align-items:center;justify-content:space-between;position:sticky;top:0;z-index:100;box-shadow:var(--s1);}
.tb-left{display:flex;align-items:center;gap:.75rem;}
.mob-btn{display:none;background:none;border:none;font-size:1.15rem;cursor:pointer;color:var(--t2);padding:.25rem;}
.tb-seal{width:36px;height:36px;border-radius:50%;overflow:hidden;border:2px solid var(--bdr);box-shadow:var(--s1);cursor:pointer;transition:transform .3s,box-shadow .3s;flex-shrink:0;}
.tb-seal:hover{transform:scale(1.1) rotate(10deg);box-shadow:0 0 14px rgba(212,160,23,.4);border-color:var(--gold);}
.tb-seal img{width:100%;height:100%;object-fit:cover;}
.tb-title{font-family:'Poppins',sans-serif;font-weight:700;font-size:1.05rem;color:var(--t1);}
.tb-bread{font-size:.72rem;color:var(--t3);display:flex;align-items:center;gap:.3rem;}
.tb-bread i{font-size:.6rem;}
.tb-right{display:flex;align-items:center;gap:.75rem;}
.date-pill{background:var(--surf2);border:1px solid var(--bdr);border-radius:30px;padding:.35rem .9rem;font-size:.73rem;color:var(--t2);font-weight:700;display:flex;align-items:center;gap:.35rem;}
.date-pill i{color:var(--gold);font-size:.75rem;}
.tb-btn{width:38px;height:38px;background:var(--surf2);border:1px solid var(--bdr);border-radius:var(--r1);display:flex;align-items:center;justify-content:center;cursor:pointer;color:var(--t2);font-size:.92rem;transition:all .2s;box-shadow:0 2px 0 var(--bdr);position:relative;}
.tb-btn:hover{background:var(--maroon);color:#fff;transform:translateY(-2px);box-shadow:0 4px 0 var(--maroon-d);}
.n-pip{position:absolute;top:6px;right:6px;width:8px;height:8px;background:var(--gold);border-radius:50%;border:2px solid var(--surf);animation:pip 2s ease-in-out infinite;}
@keyframes pip{0%,100%{transform:scale(1);box-shadow:0 0 0 0 rgba(212,160,23,.4);}50%{transform:scale(1.2);box-shadow:0 0 0 5px rgba(212,160,23,0);}}

/* ═══ PAGES ═══ */
.content{padding:1.875rem 2rem;flex:1;}
.page{display:none;animation:pgIn .22s ease;}
.page.active{display:block;}
@keyframes pgIn{from{opacity:0;transform:translateY(8px);}to{opacity:1;transform:translateY(0);}}

/* ═══ HERO ═══ */
.hero{border-radius:var(--r4);margin-bottom:1.75rem;position:relative;overflow:hidden;min-height:188px;box-shadow:var(--s3d);transition:transform .3s,box-shadow .3s;}
.hero:hover{transform:translateY(-4px);box-shadow:var(--s3dh);}
.hero-bg-img{position:absolute;inset:0;background-image:url('data:image/png;base64,');background-size:cover;background-position:center 40%;filter:brightness(.32) saturate(1.3);}
.hero-ov{position:absolute;inset:0;background:linear-gradient(115deg,rgba(52,10,10,.95) 0%,rgba(82,16,16,.88) 40%,rgba(123,29,29,.6) 70%,transparent 100%);}
.hero-ov2{position:absolute;inset:0;background:radial-gradient(ellipse 50% 90% at 90% 50%,rgba(212,160,23,.13),transparent);}
.hero-particles{position:absolute;inset:0;overflow:hidden;pointer-events:none;}
.hero-particles span{position:absolute;border-radius:50%;background:rgba(212,160,23,.12);animation:floatP var(--dur,8s) ease-in-out infinite;animation-delay:var(--del,0s);}
@keyframes floatP{0%,100%{transform:translateY(0) scale(1);opacity:.12;}50%{transform:translateY(-20px) scale(1.1);opacity:.28;}}
.hero-content{position:relative;z-index:2;padding:2rem 2.25rem;display:flex;align-items:center;justify-content:space-between;gap:1.5rem;}
.hero-eyebrow{font-size:.67rem;text-transform:uppercase;letter-spacing:3px;color:rgba(255,255,255,.42);margin-bottom:.4rem;display:flex;align-items:center;gap:.4rem;}
.hero-eyebrow i{color:var(--gold);}
.hero-title{font-family:'Poppins',sans-serif;font-size:1.85rem;font-weight:800;color:#fff;line-height:1.2;margin-bottom:.4rem;text-shadow:0 2px 14px rgba(0,0,0,.3);}
.hero-title .hl{color:var(--gold-l);text-shadow:0 0 22px rgba(240,192,64,.5);}
.hero-sub{color:rgba(255,255,255,.52);font-size:.87rem;}
.hero-acts{margin-top:1.35rem;display:flex;gap:.7rem;flex-wrap:wrap;}
.hero-seal-wrap{flex-shrink:0;display:flex;flex-direction:column;align-items:center;gap:.5rem;}
.hero-seal-ring{position:relative;width:110px;height:110px;animation:sealFloat 5s ease-in-out infinite;}
.hero-seal-ring::before{content:'';position:absolute;inset:-5px;border-radius:50%;background:conic-gradient(rgba(212,160,23,.6),rgba(240,192,64,.9),rgba(212,160,23,.6),rgba(240,192,64,.9),rgba(212,160,23,.6));animation:sealRotate 8s linear infinite;}
.hero-seal-ring::after{content:'';position:absolute;inset:-2px;border-radius:50%;background:var(--maroon-d);}
.hero-seal-img{position:absolute;inset:0;width:100%;height:100%;border-radius:50%;object-fit:cover;z-index:1;border:3px solid rgba(212,160,23,.45);box-shadow:0 0 0 6px rgba(212,160,23,.1),0 8px 32px rgba(0,0,0,.5);}
.hero-seal-txt{font-size:.6rem;color:rgba(255,255,255,.35);text-transform:uppercase;letter-spacing:1.5px;text-align:center;}

/* ═══ BUTTONS ═══ */
.btn{display:inline-flex;align-items:center;gap:.45rem;padding:.58rem 1.2rem;border-radius:var(--r1);font-family:'Nunito',sans-serif;font-size:.85rem;font-weight:800;cursor:pointer;border:none;transition:all .2s cubic-bezier(.4,0,.2,1);text-decoration:none;position:relative;overflow:hidden;white-space:nowrap;}
.btn::before{content:'';position:absolute;inset:0;background:linear-gradient(to bottom,rgba(255,255,255,.1),transparent);pointer-events:none;}
.btn:hover{transform:translateY(-2px);}
.btn:active{transform:translateY(1px);}
.btn-gold{background:linear-gradient(135deg,var(--gold),var(--gold-l));color:var(--maroon-d);box-shadow:0 4px 0 #7A5800,0 6px 16px rgba(212,160,23,.3);}
.btn-gold:hover{box-shadow:0 6px 0 #7A5800,0 10px 24px rgba(212,160,23,.4);}
.btn-ghost{background:rgba(255,255,255,.1);color:rgba(255,255,255,.85);border:1px solid rgba(255,255,255,.2);box-shadow:0 3px 0 rgba(0,0,0,.18);}
.btn-ghost:hover{background:rgba(255,255,255,.18);}
.btn-outline{background:var(--surf);color:var(--maroon);border:1.5px solid var(--bdr);box-shadow:0 3px 0 var(--bdr);}
.btn-outline:hover{border-color:var(--maroon);box-shadow:0 3px 0 var(--maroon);}
.btn-maroon{background:linear-gradient(135deg,var(--maroon),var(--maroon-l));color:#fff;box-shadow:0 4px 0 var(--maroon-d);}
.btn-maroon:hover{box-shadow:0 6px 0 var(--maroon-d);}
.btn-sm{padding:.38rem .875rem;font-size:.77rem;}
.btn-xs{padding:.28rem .6rem;font-size:.7rem;}
.btn-danger{background:linear-gradient(135deg,#b91c1c,#991b1b);color:#fff;box-shadow:0 3px 0 #7f1d1d;}
.btn-success{background:linear-gradient(135deg,#166534,#15803d);color:#fff;box-shadow:0 3px 0 #14532d;}

/* ═══ STATS ═══ */
.stats-grid{display:grid;grid-template-columns:repeat(4,1fr);gap:1.1rem;margin-bottom:1.75rem;}
.sc{background:var(--surf);border-radius:var(--r3);padding:1.4rem 1.5rem;border:1px solid var(--bdr);position:relative;overflow:hidden;transition:all .28s cubic-bezier(.4,0,.2,1);box-shadow:var(--s1);cursor:default;}
.sc::after{content:'';position:absolute;bottom:0;left:0;width:100%;height:3px;background:var(--sk);border-radius:0 0 var(--r3) var(--r3);transform:scaleX(.2);transform-origin:left;transition:transform .35s ease;}
.sc::before{content:'';position:absolute;top:-28px;right:-28px;width:100px;height:100px;border-radius:50%;background:var(--sk);opacity:.04;transition:transform .3s,opacity .3s;}
.sc:hover{transform:translateY(-8px) scale(1.02);box-shadow:0 8px 0 var(--sk-s),var(--s3);border-color:transparent;}
.sc:hover::after{transform:scaleX(1);}
.sc:hover::before{transform:scale(1.4);opacity:.08;}
.sc.s-t{--sk:var(--maroon);--sk-s:rgba(123,29,29,.18);}
.sc.s-p{--sk:var(--gold);--sk-s:rgba(212,160,23,.2);}
.sc.s-i{--sk:#1A5276;--sk-s:rgba(26,82,118,.18);}
.sc.s-d{--sk:#1D6A3B;--sk-s:rgba(29,106,59,.18);}
.sc-icon{width:46px;height:46px;border-radius:var(--r1);background:var(--ib2);display:flex;align-items:center;justify-content:center;font-size:1.1rem;color:var(--ic2);margin-bottom:.875rem;box-shadow:0 4px 0 rgba(0,0,0,.1);transition:all .3s;position:relative;z-index:1;}
.sc:hover .sc-icon{transform:rotate(-10deg) scale(1.15) translateY(-2px);}
.sc.s-t .sc-icon{--ib2:#FDECEA;--ic2:var(--maroon);}
.sc.s-p .sc-icon{--ib2:var(--gold-p);--ic2:#92600A;}
.sc.s-i .sc-icon{--ib2:var(--ib);--ic2:#154360;}
.sc.s-d .sc-icon{--ib2:var(--db);--ic2:#145A32;}
.sc-num{font-family:'Poppins',sans-serif;font-size:2.35rem;font-weight:800;color:var(--t1);line-height:1;margin-bottom:.2rem;position:relative;z-index:1;transition:color .3s;}
.sc:hover .sc-num{color:var(--sk);}
.sc-lbl{font-size:.68rem;text-transform:uppercase;letter-spacing:1.2px;color:var(--t3);font-weight:800;position:relative;z-index:1;}
.sc-foot{font-size:.7rem;color:var(--t3);margin-top:.6rem;padding-top:.6rem;border-top:1px solid var(--bdr);display:flex;align-items:center;gap:.3rem;position:relative;z-index:1;}
.sc-foot.warn{color:#92600A;}.sc-foot.up{color:#145A32;}
.sc:nth-child(1){animation:fadeUp .5s .05s ease both;}
.sc:nth-child(2){animation:fadeUp .5s .10s ease both;}
.sc:nth-child(3){animation:fadeUp .5s .15s ease both;}
.sc:nth-child(4){animation:fadeUp .5s .20s ease both;}
@keyframes fadeUp{from{opacity:0;transform:translateY(16px);}to{opacity:1;transform:translateY(0);}}

/* ═══ PANEL ═══ */
.panel{background:var(--surf);border-radius:var(--r3);border:1px solid var(--bdr);box-shadow:var(--s1);overflow:hidden;transition:box-shadow .25s;}
.panel:hover{box-shadow:var(--s2);}
.panel-h{padding:1rem 1.35rem;border-bottom:1px solid var(--bdr);display:flex;align-items:center;justify-content:space-between;background:linear-gradient(to right,var(--surf2),var(--surf));}
.panel-h h3{font-family:'Poppins',sans-serif;font-size:.92rem;font-weight:700;color:var(--t1);display:flex;align-items:center;gap:.4rem;margin:0;}
.panel-h h3 i{color:var(--maroon);}
.panel-h-sub{font-size:.7rem;color:var(--t3);margin-top:.12rem;}
.panel-h-link{font-size:.75rem;color:var(--maroon);font-weight:700;text-decoration:none;display:flex;align-items:center;gap:.3rem;transition:opacity .2s;white-space:nowrap;cursor:pointer;}
.panel-h-link:hover{opacity:.7;}
.panel-body{padding:1.25rem 1.35rem;}

/* ═══ BADGES ═══ */
.badge{display:inline-flex;align-items:center;gap:.28rem;padding:.22rem .65rem;border-radius:20px;font-size:.65rem;font-weight:800;text-transform:uppercase;letter-spacing:.4px;white-space:nowrap;transition:transform .2s;}
.badge:hover{transform:scale(1.06);}
.badge::before{content:'';width:5px;height:5px;border-radius:50%;background:currentColor;animation:dot 2s ease-in-out infinite;}
@keyframes dot{0%,100%{opacity:1;transform:scale(1);}50%{opacity:.4;transform:scale(.7);}}
.b-critical{background:#FDEDEC;color:#7B241C;}
.b-high{background:#FEF0E7;color:#873600;}
.b-medium{background:var(--ib);color:#154360;}
.b-low{background:var(--surf2);color:var(--t3);border:1px solid var(--bdr);}
.b-assigned{background:var(--gold-p);color:#92600A;}
.b-progress{background:var(--ib);color:#154360;}
.b-done{background:var(--db);color:#145A32;}
.b-pending{background:var(--pb);color:var(--pc);}
.b-rejected{background:var(--rb);color:var(--rc);}
.b-validated{background:var(--db);color:var(--dc);}
.b-warning{background:#FFF8E1;color:#F57F17;}
.b-incomplete{background:var(--rb);color:var(--rc);}

/* ═══ FILTER BAR ═══ */
.fbar{padding:.75rem 1.1rem;display:flex;gap:.55rem;align-items:center;flex-wrap:wrap;border-bottom:1px solid var(--bdr);background:var(--surf2);}
.sw{position:relative;flex:1;min-width:155px;}
.sw i{position:absolute;left:.7rem;top:50%;transform:translateY(-50%);color:var(--t3);font-size:.75rem;pointer-events:none;}
.si{width:100%;padding:.46rem .7rem .46rem 1.9rem;background:var(--surf);border:1.5px solid var(--bdr);border-radius:var(--r1);font-size:.81rem;color:var(--t1);font-family:'Nunito',sans-serif;outline:none;transition:border-color .2s;}
.si:focus{border-color:var(--maroon);box-shadow:0 0 0 3px rgba(123,29,29,.07);}
.fsel{padding:.46rem .7rem;background:var(--surf);border:1.5px solid var(--bdr);border-radius:var(--r1);font-size:.81rem;color:var(--t2);font-family:'Nunito',sans-serif;outline:none;cursor:pointer;}
.fsel:focus{border-color:var(--maroon);}
.ftab{display:flex;gap:.3rem;}
.ftab-btn{padding:.4rem .85rem;border-radius:20px;font-size:.75rem;font-weight:700;cursor:pointer;border:1.5px solid var(--bdr);background:var(--surf);color:var(--t3);transition:all .18s;font-family:'Nunito',sans-serif;}
.ftab-btn.active,.ftab-btn:hover{background:var(--maroon);color:#fff;border-color:var(--maroon);}

/* ═══ TABLE ═══ */
.tbl{width:100%;border-collapse:collapse;}
.tbl thead th{padding:.62rem 1.1rem;font-size:.65rem;text-transform:uppercase;letter-spacing:1px;color:var(--t3);font-weight:800;text-align:left;background:var(--surf2);border-bottom:1.5px solid var(--bdr);white-space:nowrap;}
.tbl tbody td{padding:.78rem 1.1rem;font-size:.82rem;color:var(--t1);border-bottom:1px solid var(--bdr);vertical-align:middle;}
.tbl tbody tr:last-child td{border-bottom:none;}
.tbl tbody tr{transition:background .12s,transform .1s;}
.tbl tbody tr:hover td{background:var(--surf2);}
.tbl tbody tr:hover{transform:translateX(3px);}
.tbl-id{font-family:'Poppins',sans-serif;font-weight:800;color:var(--maroon);font-size:.8rem;}
.tbl-name{font-weight:700;color:var(--t1);}
.tbl-sub{font-size:.68rem;color:var(--t3);margin-top:1px;}
.act-btn{width:30px;height:30px;border-radius:var(--r1);display:inline-flex;align-items:center;justify-content:center;font-size:.75rem;cursor:pointer;border:1px solid var(--bdr);background:var(--surf2);color:var(--t2);transition:all .2s;margin-right:3px;}
.act-btn:hover{background:var(--maroon);color:#fff;border-color:var(--maroon-d);transform:translateY(-1px);box-shadow:0 3px 0 var(--maroon-d);}
.act-btn.g:hover{background:#145A32;border-color:#0e3d22;box-shadow:0 3px 0 #0e3d22;}
.act-btn.r:hover{background:#b91c1c;border-color:#7f1d1d;box-shadow:0 3px 0 #7f1d1d;}

/* ═══ REPORT CARDS ═══ */
.report-grid{display:grid;grid-template-columns:repeat(auto-fill,minmax(280px,1fr));gap:1rem;}
.rcard{background:var(--surf);border-radius:var(--r3);border:1px solid var(--bdr);overflow:hidden;transition:all .28s cubic-bezier(.4,0,.2,1);box-shadow:var(--s1);}
.rcard:hover{transform:translateY(-5px);box-shadow:var(--s3d);}
.rcard-img{height:140px;background:var(--surf2);position:relative;overflow:hidden;cursor:pointer;}
.rcard-img img{width:100%;height:100%;object-fit:cover;transition:transform .4s;}
.rcard:hover .rcard-img img{transform:scale(1.05);}
.rcard-img-placeholder{width:100%;height:100%;display:flex;align-items:center;justify-content:center;background:linear-gradient(135deg,var(--surf2),var(--bdr));}
.rcard-img-placeholder i{font-size:2.5rem;color:var(--t3);opacity:.4;}
.rcard-img-count{position:absolute;bottom:8px;right:8px;background:rgba(0,0,0,.6);color:#fff;font-size:.65rem;font-weight:700;padding:2px 8px;border-radius:20px;backdrop-filter:blur(4px);}
.rcard-body{padding:1rem 1.1rem;}
.rcard-top{display:flex;align-items:center;justify-content:space-between;margin-bottom:.55rem;}
.rcard-id{font-family:'Poppins',sans-serif;font-weight:800;color:var(--maroon);font-size:.78rem;}
.rcard-title{font-family:'Poppins',sans-serif;font-size:.92rem;font-weight:700;color:var(--t1);margin-bottom:.25rem;}
.rcard-meta{display:flex;flex-wrap:wrap;gap:.5rem;font-size:.72rem;color:var(--t3);margin-bottom:.7rem;}
.rcard-meta span{display:flex;align-items:center;gap:.22rem;}
.rcard-meta i{font-size:.65rem;color:var(--maroon);}
.rcard-desc{font-size:.78rem;color:var(--t2);line-height:1.5;margin-bottom:.8rem;display:-webkit-box;-webkit-line-clamp:2;-webkit-box-orient:vertical;overflow:hidden;}
.rcard-valid{display:flex;align-items:center;gap:.4rem;font-size:.72rem;font-weight:700;margin-bottom:.7rem;padding:.35rem .6rem;border-radius:var(--r1);}
.rcard-valid.ok{background:var(--db);color:var(--dc);}
.rcard-valid.warn{background:#FFF8E1;color:#F57F17;}
.rcard-valid.err{background:var(--rb);color:var(--rc);}
.rcard-actions{display:flex;gap:.5rem;}

/* ═══ VALIDATION INDICATORS ═══ */
.val-item{display:flex;align-items:center;gap:.5rem;padding:.4rem 0;font-size:.78rem;}
.val-icon{width:20px;height:20px;border-radius:50%;display:flex;align-items:center;justify-content:center;font-size:.6rem;flex-shrink:0;}
.val-icon.ok{background:var(--db);color:var(--dc);}
.val-icon.warn{background:#FFF8E1;color:#F57F17;}
.val-icon.err{background:var(--rb);color:var(--rc);}

/* ═══ WORK ORDER FORM ═══ */
.fr{display:grid;grid-template-columns:1fr 1fr;gap:.875rem;}
.fg{display:flex;flex-direction:column;gap:.36rem;margin-bottom:.875rem;}
.fg.full{grid-column:1/-1;}
.fl{font-size:.7rem;font-weight:800;text-transform:uppercase;letter-spacing:.8px;color:var(--t2);}
.fl span{color:var(--maroon);}
.fc{padding:.56rem .85rem;background:var(--surf);border:1.5px solid var(--bdr);border-radius:var(--r1);font-size:.84rem;color:var(--t1);font-family:'Nunito',sans-serif;outline:none;transition:border-color .2s,box-shadow .2s;}
.fc:focus{border-color:var(--maroon);box-shadow:0 0 0 3px rgba(123,29,29,.08);}
.fc::placeholder{color:var(--t3);}
textarea.fc{resize:vertical;min-height:80px;}
select.fc{cursor:pointer;}

/* ═══ TIMELINE ═══ */
.tl{padding:.4rem 0;}
.tls{display:flex;gap:.8rem;align-items:flex-start;position:relative;padding-bottom:1.1rem;}
.tls:last-child{padding-bottom:0;}
.tls:not(:last-child)::before{content:'';position:absolute;left:16px;top:34px;bottom:0;width:2px;background:var(--bdr);}
.tld{width:34px;height:34px;border-radius:50%;flex-shrink:0;display:flex;align-items:center;justify-content:center;font-size:.78rem;font-weight:700;box-shadow:0 2px 0 rgba(0,0,0,.1);}
.tld.done{background:linear-gradient(135deg,#145A32,#1D8348);color:#fff;}
.tld.act{background:linear-gradient(135deg,var(--maroon),var(--maroon-l));color:#fff;box-shadow:0 2px 0 var(--maroon-d),0 0 14px rgba(123,29,29,.3);animation:tlP 2s ease-in-out infinite;}
.tld.idle{background:var(--surf2);color:var(--t3);border:1.5px solid var(--bdr);}
@keyframes tlP{0%,100%{box-shadow:0 2px 0 var(--maroon-d),0 0 10px rgba(123,29,29,.25);}50%{box-shadow:0 2px 0 var(--maroon-d),0 0 22px rgba(123,29,29,.5);}}
.tlt strong{display:block;font-size:.81rem;font-weight:700;color:var(--t1);}
.tlt span{font-size:.71rem;color:var(--t3);}

/* ═══ ACTIVITY FEED ═══ */
.act-list{padding:.75rem 1.1rem;display:flex;flex-direction:column;}
.act-item{display:flex;align-items:flex-start;gap:.75rem;padding:.7rem 0;border-bottom:1px solid var(--bdr);transition:all .12s;cursor:pointer;}
.act-item:last-child{border:none;}
.act-item:hover{background:var(--surf2);margin:0 -.5rem;padding-left:.5rem;padding-right:.5rem;border-radius:var(--r1);}
.act-dot{width:10px;height:10px;border-radius:50%;flex-shrink:0;margin-top:4px;}
.act-dot.maroon{background:var(--maroon);box-shadow:0 0 8px rgba(123,29,29,.4);}
.act-dot.gold{background:var(--gold);box-shadow:0 0 8px rgba(212,160,23,.4);}
.act-dot.green{background:#1D8348;box-shadow:0 0 8px rgba(29,131,72,.4);}
.act-dot.red{background:#922B21;box-shadow:0 0 8px rgba(146,43,33,.4);}
.act-txt strong{display:block;font-size:.8rem;font-weight:700;color:var(--t1);line-height:1.35;}
.act-txt span{font-size:.72rem;color:var(--t3);margin-top:.1rem;display:block;}

/* ═══ ANALYTICS / 3D WIDGETS ═══ */
.analytics-grid{display:grid;grid-template-columns:repeat(3,1fr);gap:1.25rem;margin-bottom:1.75rem;}
.widget{background:var(--surf);border-radius:var(--r3);border:1px solid var(--bdr);padding:1.4rem 1.5rem;box-shadow:var(--s1);transition:all .28s;position:relative;overflow:hidden;}
.widget:hover{transform:translateY(-4px);box-shadow:var(--s3d);}
.widget-title{font-family:'Poppins',sans-serif;font-size:.82rem;font-weight:700;color:var(--t1);margin-bottom:1rem;display:flex;align-items:center;gap:.4rem;}
.widget-title i{color:var(--maroon);}

/* 3D Bar Chart */
.bar-chart{display:flex;align-items:flex-end;gap:.5rem;height:120px;padding-bottom:.5rem;}
.bar-wrap{flex:1;display:flex;flex-direction:column;align-items:center;gap:.3rem;}
.bar{width:100%;border-radius:4px 4px 0 0;transition:all .3s cubic-bezier(.34,1.56,.64,1);cursor:pointer;position:relative;min-height:4px;transform-style:preserve-3d;}
.bar::after{content:'';position:absolute;bottom:-3px;left:0;right:0;height:3px;border-radius:0 0 2px 2px;filter:brightness(.6);background:inherit;}
.bar:hover{filter:brightness(1.1);transform:scaleY(1.05) translateY(-2px);}
.bar.maroon{background:linear-gradient(180deg,var(--maroon-l),var(--maroon));}
.bar.gold{background:linear-gradient(180deg,var(--gold-l),var(--gold));}
.bar.blue{background:linear-gradient(180deg,#2980B9,#1A5276);}
.bar.green{background:linear-gradient(180deg,#27AE60,#1D6A3B);}
.bar-lbl{font-size:.58rem;color:var(--t3);text-align:center;font-weight:700;}
.bar-val{font-size:.62rem;color:var(--t2);font-weight:800;}

/* Donut Ring */
.donut-wrap{display:flex;align-items:center;justify-content:center;gap:1.25rem;}
.donut{position:relative;width:100px;height:100px;flex-shrink:0;}
.donut svg{transform:rotate(-90deg);}
.donut-center{position:absolute;inset:0;display:flex;flex-direction:column;align-items:center;justify-content:center;}
.donut-val{font-family:'Poppins',sans-serif;font-size:1.35rem;font-weight:800;color:var(--t1);line-height:1;}
.donut-sub{font-size:.6rem;color:var(--t3);text-transform:uppercase;letter-spacing:.8px;}
.donut-legend{display:flex;flex-direction:column;gap:.4rem;}
.dl-item{display:flex;align-items:center;gap:.4rem;font-size:.72rem;}
.dl-dot{width:8px;height:8px;border-radius:50%;flex-shrink:0;}
.dl-label{color:var(--t2);flex:1;}
.dl-val{font-weight:800;color:var(--t1);}

/* Progress bars */
.prog-list{display:flex;flex-direction:column;gap:.875rem;}
.prog-item{}
.prog-top{display:flex;justify-content:space-between;margin-bottom:.3rem;}
.prog-label{font-size:.75rem;font-weight:700;color:var(--t2);}
.prog-val{font-size:.75rem;font-weight:800;color:var(--t1);}
.prog-bar{height:8px;background:var(--surf2);border-radius:20px;overflow:hidden;border:1px solid var(--bdr);}
.prog-fill{height:100%;border-radius:20px;transition:width 1.2s cubic-bezier(.4,0,.2,1);}

/* ═══ AI SUMMARY PANEL ═══ */
.ai-panel{background:linear-gradient(135deg,#3D0A0A,var(--maroon-d),var(--maroon));border-radius:var(--r3);padding:1.35rem 1.5rem;margin-bottom:1.75rem;position:relative;overflow:hidden;box-shadow:var(--s3d);}
.ai-panel::before{content:'';position:absolute;right:-20px;top:-20px;width:120px;height:120px;border-radius:50%;border:2px solid rgba(212,160,23,.2);background:rgba(212,160,23,.05);animation:sealRotate 20s linear infinite;}
.ai-panel::after{content:'';position:absolute;right:30px;top:10px;width:70px;height:70px;border-radius:50%;border:1px solid rgba(212,160,23,.1);background:rgba(212,160,23,.03);animation:sealRotate 15s linear infinite reverse;}
.ai-panel-inner{position:relative;z-index:1;display:flex;align-items:flex-start;gap:1.25rem;}
.ai-icon{width:46px;height:46px;background:rgba(212,160,23,.2);border:1px solid rgba(212,160,23,.35);border-radius:var(--r2);display:flex;align-items:center;justify-content:center;font-size:1.1rem;color:var(--gold-l);flex-shrink:0;animation:aiPulse 3s ease-in-out infinite;}
@keyframes aiPulse{0%,100%{box-shadow:0 0 0 0 rgba(212,160,23,.3);}50%{box-shadow:0 0 0 8px rgba(212,160,23,0);}}
.ai-content h4{font-family:'Poppins',sans-serif;font-size:.88rem;font-weight:800;color:var(--gold-l);margin-bottom:.3rem;}
.ai-content p{font-size:.8rem;color:rgba(255,255,255,.65);line-height:1.6;}
.ai-tags{display:flex;gap:.4rem;flex-wrap:wrap;margin-top:.6rem;}
.ai-tag{background:rgba(212,160,23,.18);border:1px solid rgba(212,160,23,.3);color:rgba(255,255,255,.7);font-size:.65rem;font-weight:700;padding:2px 9px;border-radius:20px;text-transform:uppercase;letter-spacing:.5px;}

/* ═══ NOTIFICATION ITEMS ═══ */
.nlist{padding:.5rem;}
.ni2{padding:.825rem 1.1rem;border-radius:var(--r2);cursor:pointer;transition:all .18s;display:flex;gap:.7rem;margin-bottom:.3rem;position:relative;}
.ni2:hover{background:var(--surf2);transform:translateX(4px);}
.ni2.unread{background:linear-gradient(to right,rgba(212,160,23,.08),transparent);}
.ni2.unread::before{content:'';position:absolute;left:0;top:.825rem;bottom:.825rem;width:3px;background:linear-gradient(to bottom,var(--gold),var(--gold-l));border-radius:2px;}
.ni-ic{width:34px;height:34px;flex-shrink:0;border-radius:var(--r1);background:var(--surf2);display:flex;align-items:center;justify-content:center;font-size:.85rem;color:var(--maroon);box-shadow:0 2px 0 var(--bdr);transition:transform .2s;}
.ni2:hover .ni-ic{transform:scale(1.1) rotate(-5deg);}
.ni-b strong{display:block;font-size:.83rem;color:var(--t1);font-weight:700;}
.ni-b p{font-size:.74rem;color:var(--t2);margin-top:.1rem;line-height:1.45;}
.ni-t{font-size:.66rem;color:var(--t3);margin-top:.28rem;display:flex;align-items:center;gap:.2rem;}

/* ═══ PROFILE ═══ */
.pgrid{display:grid;grid-template-columns:1fr 1.65fr;gap:1.35rem;}
.pc-card{background:var(--surf);border-radius:var(--r3);border:1px solid var(--bdr);overflow:hidden;box-shadow:var(--s1);}
.pc-head{position:relative;overflow:hidden;background:linear-gradient(135deg,#3D0A0A,var(--maroon-d),var(--maroon));padding:0;}
.pc-head-cont{position:relative;z-index:1;padding:1.75rem;text-align:center;}
.pc-av{width:72px;height:72px;border-radius:50%;margin:0 auto .75rem;border:3px solid rgba(212,160,23,.45);box-shadow:0 0 0 5px rgba(212,160,23,.1),0 6px 20px rgba(0,0,0,.4);background:linear-gradient(135deg,var(--gold),var(--maroon-l));display:flex;align-items:center;justify-content:center;font-family:'Poppins',sans-serif;font-weight:800;font-size:1.6rem;color:#fff;}
.pc-head h2{font-family:'Poppins',sans-serif;font-size:1.1rem;font-weight:800;color:#fff;}
.pc-head p{color:rgba(255,255,255,.45);font-size:.76rem;margin-top:.18rem;}
.pc-body{padding:1.25rem 1.4rem;}
.dr{display:flex;gap:1rem;padding:.55rem 0;border-bottom:1px solid var(--bdr);align-items:flex-start;}
.dr:last-child{border:none;}
.dk{width:115px;flex-shrink:0;font-size:.68rem;font-weight:800;text-transform:uppercase;letter-spacing:.7px;color:var(--t3);padding-top:.12rem;}
.dv{font-size:.85rem;color:var(--t1);flex:1;}
.pc-footer{padding:.875rem 1.4rem;border-top:1px solid var(--bdr);display:flex;align-items:center;gap:.7rem;background:var(--surf2);}
.fstack{display:flex;flex-direction:column;gap:1.2rem;}

/* ═══ MODAL ═══ */
.mo{position:fixed;inset:0;background:rgba(26,10,10,.62);backdrop-filter:blur(6px);z-index:500;display:none;align-items:center;justify-content:center;padding:1rem;}
.mo.open{display:flex;animation:moFI .18s ease;}
@keyframes moFI{from{opacity:0;}to{opacity:1;}}
.modal{background:var(--surf);border-radius:var(--r4);width:100%;max-width:600px;max-height:90vh;overflow-y:auto;box-shadow:var(--s3);animation:mUp .28s cubic-bezier(.4,0,.2,1);border:1px solid var(--bdr);}
.modal.modal-lg{max-width:780px;}
.modal::-webkit-scrollbar{width:4px;}
.modal::-webkit-scrollbar-thumb{background:var(--bdr);border-radius:4px;}
@keyframes mUp{from{transform:translateY(20px);opacity:0;}to{transform:translateY(0);opacity:1;}}
.m-head{padding:1.4rem 1.65rem 1.2rem;display:flex;justify-content:space-between;align-items:flex-start;background:linear-gradient(115deg,#3D0A0A,var(--maroon));border-radius:var(--r4) var(--r4) 0 0;position:relative;overflow:hidden;}
.m-head::after{content:'';position:absolute;right:-15px;top:-15px;width:90px;height:90px;border-radius:50%;border:2px solid rgba(212,160,23,.2);background:rgba(212,160,23,.06);animation:sealRotate 20s linear infinite;}
.mh-t h2{font-family:'Poppins',sans-serif;font-size:1.05rem;font-weight:800;color:#fff;position:relative;z-index:1;}
.mh-t p{font-size:.73rem;color:rgba(255,255,255,.42);margin-top:.15rem;position:relative;z-index:1;}
.m-x{width:28px;height:28px;background:rgba(255,255,255,.1);border:none;border-radius:50%;color:rgba(255,255,255,.65);font-size:.88rem;cursor:pointer;transition:all .18s;display:flex;align-items:center;justify-content:center;flex-shrink:0;position:relative;z-index:1;}
.m-x:hover{background:rgba(255,255,255,.22);color:#fff;transform:rotate(90deg);}
.m-body{padding:1.5rem 1.65rem;}
.m-foot{padding:1rem 1.65rem 1.4rem;border-top:1px solid var(--bdr);display:flex;justify-content:flex-end;gap:.55rem;}
.dr2{display:flex;gap:1rem;padding:.55rem 0;border-bottom:1px solid var(--bdr);align-items:flex-start;}
.dr2:last-child{border:none;}
.dk2{width:120px;flex-shrink:0;font-size:.68rem;font-weight:800;text-transform:uppercase;letter-spacing:.7px;color:var(--t3);}
.dv2{font-size:.84rem;color:var(--t1);flex:1;}

/* Photo flip modal */
.flip-container{perspective:1000px;width:100%;}
.flip-card{transform-style:preserve-3d;transition:transform .7s cubic-bezier(.4,0,.2,1);border-radius:var(--r2);overflow:hidden;}
.flip-card.flipped{transform:rotateY(180deg);}
.flip-front,.flip-back{backface-visibility:hidden;border-radius:var(--r2);overflow:hidden;}
.flip-back{position:absolute;inset:0;transform:rotateY(180deg);background:var(--surf2);display:flex;align-items:center;justify-content:center;}
.img-slider{display:flex;gap:.5rem;overflow-x:auto;padding:.5rem 0;scrollbar-width:thin;}
.img-thumb{width:70px;height:52px;border-radius:var(--r1);overflow:hidden;cursor:pointer;border:2px solid var(--bdr);flex-shrink:0;transition:border-color .2s;}
.img-thumb.active{border-color:var(--maroon);}
.img-thumb img{width:100%;height:100%;object-fit:cover;}

/* ═══ TOAST ═══ */
.ttray{position:fixed;bottom:1.75rem;right:1.75rem;display:flex;flex-direction:column;gap:.42rem;z-index:9999;}
.toast{background:var(--surf);border:1px solid var(--bdr);border-radius:var(--r2);padding:.8rem 1rem;display:flex;align-items:flex-start;gap:.6rem;box-shadow:var(--s3);min-width:265px;border-left:4px solid var(--maroon);transform:translateX(80px);opacity:0;transition:all .3s cubic-bezier(.34,1.4,.64,1);}
.toast.show{transform:translateX(0);opacity:1;}
.toast.ok{border-left-color:#145A32;}.toast.err{border-left-color:#7B241C;}.toast.warn{border-left-color:#F57F17;}
.t-ic{font-size:.95rem;color:var(--maroon);margin-top:1px;}
.toast.ok .t-ic{color:#145A32;}.toast.err .t-ic{color:#7B241C;}.toast.warn .t-ic{color:#F57F17;}
.t-txt{font-size:.81rem;font-weight:700;color:var(--t1);}
.t-sub{font-size:.72rem;color:var(--t2);margin-top:1px;}

/* ═══ SECTION HEADER ═══ */
.sh{display:flex;align-items:center;justify-content:space-between;margin-bottom:1.1rem;}
.sh h2{font-family:'Poppins',sans-serif;font-size:.98rem;font-weight:700;color:var(--t1);display:flex;align-items:center;gap:.4rem;}
.sh h2 i{color:var(--maroon);}

/* ═══ TWO-COL ═══ */
.two-col{display:grid;grid-template-columns:1fr 320px;gap:1.25rem;margin-bottom:1.75rem;}
.three-col{display:grid;grid-template-columns:1fr 1fr 1fr;gap:1.25rem;margin-bottom:1.75rem;}

/* ═══ EMPTY STATE ═══ */
.empty{text-align:center;padding:3rem 1.5rem;color:var(--t3);}
.empty i{font-size:2.5rem;margin-bottom:.75rem;opacity:.22;display:block;}
.empty p{font-size:.82rem;}

/* ═══ QUICK ACTIONS ═══ */
.quick-grid{display:grid;grid-template-columns:repeat(4,1fr);gap:1.1rem;margin-bottom:1.75rem;}
.qc{background:var(--surf);border-radius:var(--r3);border:1px solid var(--bdr);padding:1.2rem 1.35rem;display:flex;align-items:center;gap:.9rem;cursor:pointer;text-decoration:none;box-shadow:var(--s1);transition:all .25s cubic-bezier(.34,1.3,.64,1);}
.qc:hover{transform:translateY(-5px);box-shadow:var(--s3d);border-color:rgba(212,160,23,.3);background:var(--surf2);}
.qc-icon{width:44px;height:44px;border-radius:var(--r1);display:flex;align-items:center;justify-content:center;font-size:1.1rem;flex-shrink:0;box-shadow:0 3px 0 rgba(0,0,0,.1);transition:transform .3s;}
.qc:hover .qc-icon{transform:scale(1.1) rotate(-5deg);}
.qc-icon.t{background:#FDECEA;color:var(--maroon);}.qc-icon.p{background:var(--gold-p);color:#92600A;}.qc-icon.d{background:var(--db);color:#145A32;}.qc-icon.i{background:var(--ib);color:#154360;}
.qc h4{font-family:'Poppins',sans-serif;font-size:.83rem;font-weight:700;color:var(--t1);margin-bottom:.1rem;}
.qc p{font-size:.72rem;color:var(--t3);line-height:1.35;}

/* ═══ INSIGHTS ═══ */
.insight-item{display:flex;align-items:flex-start;gap:.75rem;padding:.875rem 0;border-bottom:1px solid var(--bdr);}
.insight-item:last-child{border:none;}
.ins-icon{width:36px;height:36px;border-radius:var(--r1);display:flex;align-items:center;justify-content:center;font-size:.85rem;flex-shrink:0;}
.ins-icon.warn{background:var(--ob);color:var(--oc);}.ins-icon.ok{background:var(--db);color:var(--dc);}.ins-icon.info{background:var(--ib);color:var(--ic);}
.ins-txt strong{display:block;font-size:.82rem;font-weight:700;color:var(--t1);}
.ins-txt span{font-size:.75rem;color:var(--t2);line-height:1.45;}

/* ═══ RESPONSIVE ═══ */
@media(max-width:1200px){
  .stats-grid{grid-template-columns:repeat(2,1fr);}
  .quick-grid{grid-template-columns:repeat(2,1fr);}
  .analytics-grid{grid-template-columns:1fr 1fr;}
  .two-col,.three-col{grid-template-columns:1fr;}
  .pgrid{grid-template-columns:1fr;}
}
@media(max-width:768px){
  .sidebar{transform:translateX(-100%);}
  .sidebar.open{transform:translateX(0);}
  .main{margin-left:0;}
  .content{padding:1.25rem 1rem;}
  .topbar{padding:0 1rem;}
  .mob-btn{display:flex;}
  .hero-seal-wrap{display:none;}
  .hero-title{font-size:1.45rem;}
  .stats-grid{grid-template-columns:1fr 1fr;}
  .analytics-grid{grid-template-columns:1fr;}
  .date-pill{display:none;}
  .fr{grid-template-columns:1fr;}
}
</style>
</head>
<body>
<div class="layout">

<!-- ════════════ SIDEBAR ════════════ -->
<aside class="sidebar" id="sidebar">
  <div class="sb-seal-area">
    <div class="seal-ring">
      <img class="seal-img" src="data:image/png;base64," alt="BEC Seal"/>
    </div>
    <div class="sb-school-name">
      <strong>Batangas Eastern Colleges</strong>
      <span>Equipment Management</span>
    </div>
  </div>
  <div class="sb-divider"></div>
  <div class="sb-user">
    <div class="u-av">JD</div>
    <div>
      <span class="u-name">Juan Dela Cruz</span>
      <div class="u-meta"><span class="u-dot"></span><span class="u-role">Technician</span></div>
    </div>
  </div>
  <nav class="sb-nav">
    <div class="nav-sep">Main Menu</div>
    <a class="nav-item active" href="#" onclick="showPage('dashboard',this)">
      <span class="ni"><i class="fas fa-th-large"></i></span>Dashboard
    </a>
    <a class="nav-item" href="#" onclick="showPage('reports',this)">
      <span class="ni"><i class="fas fa-inbox"></i></span>Incoming Reports<span class="n-badge">4</span>
    </a>
    <a class="nav-item" href="#" onclick="showPage('workorders',this)">
      <span class="ni"><i class="fas fa-clipboard-list"></i></span>Work Orders
    </a>
    <a class="nav-item" href="#" onclick="showPage('mytasks',this)">
      <span class="ni"><i class="fas fa-tasks"></i></span>My Tasks<span class="n-badge">5</span>
    </a>
    <div class="nav-sep">Records</div>
    <a class="nav-item" href="#" onclick="showPage('history',this)">
      <span class="ni"><i class="fas fa-history"></i></span>Work History
    </a>
    <a class="nav-item" href="#" onclick="showPage('analytics',this)">
      <span class="ni"><i class="fas fa-chart-bar"></i></span>Analytics
    </a>
    <div class="nav-sep">System</div>
    <a class="nav-item" href="#" onclick="showPage('notifications',this)">
      <span class="ni"><i class="fas fa-bell"></i></span>Notifications<span class="n-badge" id="nb-notif">3</span>
    </a>
    <a class="nav-item" href="#" onclick="showPage('profile',this)">
      <span class="ni"><i class="fas fa-user-shield"></i></span>Profile &amp; Security
    </a>
  </nav>
  <div class="sb-foot">
    <button class="logout-btn" onclick="confirmLogout()">
      <span class="ni" style="width:28px;height:28px;border-radius:6px;background:rgba(255,255,255,.06);display:flex;align-items:center;justify-content:center;font-size:.78rem;flex-shrink:0;"><i class="fas fa-sign-out-alt"></i></span>
      Logout
    </button>
  </div>
</aside>

<!-- ════════════ MAIN ════════════ -->
<div class="main">
  <header class="topbar">
    <div class="tb-left">
      <button class="mob-btn" onclick="document.getElementById('sidebar').classList.toggle('open')"><i class="fas fa-bars"></i></button>
      <div class="tb-seal"><img src="data:image/png;base64," alt="BEC"/></div>
      <div>
        <div class="tb-title" id="tb-title">Technician Dashboard</div>
        <div class="tb-bread"><i class="fas fa-home"></i> BEC <i class="fas fa-chevron-right"></i> <span id="tb-crumb">Dashboard</span></div>
      </div>
    </div>
    <div class="tb-right">
      <div class="date-pill"><i class="fas fa-calendar-alt"></i><span id="currentDate">—</span></div>
      <div class="tb-btn" title="Notifications" onclick="showPage('notifications',null)" style="position:relative;">
        <i class="fas fa-bell"></i><span class="n-pip" id="notif-pip"></span>
      </div>
      <div class="tb-btn" title="Profile" onclick="showPage('profile',null)"><i class="fas fa-user"></i></div>
    </div>
  </header>

  <div class="content">

  <!-- ══════════════════════════════════
       PAGE 1: DASHBOARD
  ══════════════════════════════════ -->
  <div class="page active" id="page-dashboard">

    <!-- Hero -->
    <div class="hero">
      <div class="hero-bg-img"></div>
      <div class="hero-ov"></div><div class="hero-ov2"></div>
      <div class="hero-particles">
        <span style="width:55px;height:55px;left:12%;top:20%;--dur:7s;--del:0s;"></span>
        <span style="width:30px;height:30px;left:28%;top:60%;--dur:9s;--del:1s;"></span>
        <span style="width:70px;height:70px;left:58%;top:15%;--dur:11s;--del:2s;"></span>
        <span style="width:20px;height:20px;left:72%;top:65%;--dur:6s;--del:.5s;"></span>
      </div>
      <div class="hero-content">
        <div>
          <div class="hero-eyebrow"><i class="fas fa-wrench"></i> Maintenance Technician Portal · BEC</div>
          <h1 class="hero-title">Welcome back, <span class="hl">Juan!</span></h1>
          <p class="hero-sub">Here's your maintenance overview for today — Batangas Eastern Colleges</p>
          <div class="hero-acts">
            <button class="btn btn-gold" onclick="showPage('reports',null)"><i class="fas fa-inbox"></i> View Incoming Reports</button>
            <button class="btn btn-ghost" onclick="showPage('mytasks',null)"><i class="fas fa-tasks"></i> My Tasks</button>
          </div>
        </div>
        <div class="hero-seal-wrap">
          <div class="hero-seal-ring">
            <img class="hero-seal-img" src="data:image/png;base64," alt="BEC Seal"/>
          </div>
          <span class="hero-seal-txt">Batangas Eastern Colleges</span>
        </div>
      </div>
    </div>

    <!-- AI Summary Panel -->
    <div class="ai-panel">
      <div class="ai-panel-inner">
        <div class="ai-icon"><i class="fas fa-brain"></i></div>
        <div class="ai-content">
          <h4>AI Priority Summary — Today, <span id="ai-date"></span></h4>
          <p>You have <strong style="color:var(--gold-l);">2 critical tasks</strong> requiring immediate attention. RPT-001 (AC Unit, Rm 301) has exceeded its SLA window by 2 hours. RPT-002 (Desktop #14) is pending your claim. Performance score this week: <strong style="color:var(--gold-l);">92%</strong> — excellent work!</p>
          <div class="ai-tags">
            <span class="ai-tag"><i class="fas fa-exclamation-triangle"></i> 2 Critical</span>
            <span class="ai-tag"><i class="fas fa-clock"></i> SLA Alert</span>
            <span class="ai-tag"><i class="fas fa-star"></i> 92% Score</span>
            <span class="ai-tag"><i class="fas fa-check-double"></i> 2 Done Today</span>
          </div>
        </div>
      </div>
    </div>

    <!-- KPI Stats -->
    <div class="stats-grid">
      <div class="sc s-t" onclick="showPage('reports',null)" style="cursor:pointer;">
        <div class="sc-icon"><i class="fas fa-clock"></i></div>
        <div class="sc-num" data-target="5">5</div>
        <div class="sc-lbl">Pending Tasks</div>
        <div class="sc-foot warn"><i class="fas fa-exclamation-triangle"></i> Requires attention</div>
      </div>
      <div class="sc s-p" onclick="showPage('mytasks',null)" style="cursor:pointer;">
        <div class="sc-icon"><i class="fas fa-wrench"></i></div>
        <div class="sc-num" data-target="3">3</div>
        <div class="sc-lbl">In Progress</div>
        <div class="sc-foot"><i class="fas fa-tools"></i> Currently working</div>
      </div>
      <div class="sc s-d" onclick="showPage('history',null)" style="cursor:pointer;">
        <div class="sc-icon"><i class="fas fa-check-circle"></i></div>
        <div class="sc-num" data-target="2">2</div>
        <div class="sc-lbl">Completed Today</div>
        <div class="sc-foot up"><i class="fas fa-arrow-up"></i> Great work today!</div>
      </div>
      <div class="sc s-i" onclick="showPage('analytics',null)" style="cursor:pointer;">
        <div class="sc-icon"><i class="fas fa-trophy"></i></div>
        <div class="sc-num" data-target="48">48</div>
        <div class="sc-lbl">Total Completed</div>
        <div class="sc-foot up"><i class="fas fa-chart-line"></i> Career total</div>
      </div>
    </div>

    <!-- Quick Actions -->
    <div class="sh"><h2><i class="fas fa-bolt"></i> Quick Actions</h2></div>
    <div class="quick-grid">
      <a class="qc" onclick="showPage('reports',null)"><div class="qc-icon t"><i class="fas fa-inbox"></i></div><div><h4>Incoming Reports</h4><p>View &amp; claim defect reports</p></div></a>
      <a class="qc" onclick="showPage('workorders',null)"><div class="qc-icon p"><i class="fas fa-clipboard-list"></i></div><div><h4>Work Orders</h4><p>Process &amp; manage work orders</p></div></a>
      <a class="qc" onclick="showPage('history',null)"><div class="qc-icon d"><i class="fas fa-history"></i></div><div><h4>Work History</h4><p>Review completed repairs</p></div></a>
      <a class="qc" onclick="showPage('analytics',null)"><div class="qc-icon i"><i class="fas fa-chart-bar"></i></div><div><h4>Analytics</h4><p>Performance &amp; insights</p></div></a>
    </div>

    <!-- Two-col: Recent + Activity -->
    <div class="two-col">
      <div class="panel">
        <div class="panel-h">
          <div><h3><i class="fas fa-clipboard-list"></i> Recent Work Orders</h3><div class="panel-h-sub">Latest assigned maintenance tasks</div></div>
          <span class="panel-h-link" onclick="showPage('workorders',null)">View all <i class="fas fa-arrow-right"></i></span>
        </div>
        <div style="overflow-x:auto;">
          <table class="tbl">
            <thead><tr><th>ID</th><th>Equipment</th><th>Priority</th><th>Status</th><th>Actions</th></tr></thead>
            <tbody>
              <tr><td><span class="tbl-id">RPT-100</span></td><td><div class="tbl-name">Network Switch</div><div class="tbl-sub">Server Room, Bldg D</div></td><td><span class="badge b-high">High</span></td><td><span class="badge b-progress">In Progress</span></td><td><button class="act-btn" onclick="openWorkOrderModal('RPT-100')"><i class="fas fa-eye"></i></button><button class="act-btn g" onclick="completeTask('RPT-100')"><i class="fas fa-check"></i></button></td></tr>
              <tr><td><span class="tbl-id">RPT-099</span></td><td><div class="tbl-name">Printer — Faculty Room</div><div class="tbl-sub">Faculty Rm, Bldg A</div></td><td><span class="badge b-medium">Medium</span></td><td><span class="badge b-assigned">Assigned</span></td><td><button class="act-btn" onclick="openWorkOrderModal('RPT-099')"><i class="fas fa-eye"></i></button><button class="act-btn" onclick="startTask('RPT-099')"><i class="fas fa-play"></i></button></td></tr>
              <tr><td><span class="tbl-id">RPT-098</span></td><td><div class="tbl-name">Electric Fan #7</div><div class="tbl-sub">Rm 112, Bldg B</div></td><td><span class="badge b-low">Low</span></td><td><span class="badge b-done">Completed</span></td><td><button class="act-btn" onclick="openWorkOrderModal('RPT-098')"><i class="fas fa-eye"></i></button></td></tr>
            </tbody>
          </table>
        </div>
      </div>
      <div class="panel">
        <div class="panel-h"><div><h3><i class="fas fa-bell"></i> Notifications</h3><div class="panel-h-sub">Recent alerts &amp; updates</div></div><span class="panel-h-link" onclick="showPage('notifications',null)">All <i class="fas fa-arrow-right"></i></span></div>
        <div class="act-list">
          <div class="act-item"><div class="act-dot maroon"></div><div class="act-txt"><strong>New critical task — RPT-001</strong><span>AC unit overheating · 2 min ago</span></div></div>
          <div class="act-item"><div class="act-dot green"></div><div class="act-txt"><strong>RPT-098 verified ✓</strong><span>Admin approved completion · 1hr ago</span></div></div>
          <div class="act-item"><div class="act-dot gold"></div><div class="act-txt"><strong>SLA deadline — RPT-002</strong><span>4 hours remaining · 2hrs ago</span></div></div>
          <div class="act-item"><div class="act-dot red"></div><div class="act-txt"><strong>RPT-090 revision needed</strong><span>Incomplete repair log · Yesterday</span></div></div>
          <div class="act-item"><div class="act-dot maroon"></div><div class="act-txt"><strong>New task assigned — RPT-003</strong><span>Ceiling fan · Yesterday</span></div></div>
        </div>
      </div>
    </div>
  </div>

  <!-- ══════════════════════════════════
       PAGE 2: INCOMING REPORTS QUEUE
  ══════════════════════════════════ -->
  <div class="page" id="page-reports">
    <div class="sh"><h2><i class="fas fa-inbox"></i> Incoming Reports Queue</h2><button class="btn btn-outline btn-sm"><i class="fas fa-sync-alt"></i> Refresh</button></div>
    <div class="fbar">
      <div class="sw"><i class="fas fa-search"></i><input class="si" type="text" placeholder="Search by equipment, ID, location..." oninput="filterReports(this.value)" id="report-search"/></div>
      <select class="fsel" onchange="filterReportsByPriority(this.value)"><option value="">All Priorities</option><option value="critical">Critical</option><option value="high">High</option><option value="medium">Medium</option><option value="low">Low</option></select>
      <select class="fsel" onchange="filterReportsByStatus(this.value)"><option value="">All Status</option><option value="pending">Pending</option><option value="validated">Validated</option><option value="incomplete">Incomplete</option></select>
      <select class="fsel" id="sort-sel" onchange="sortReports(this.value)"><option value="newest">Newest First</option><option value="priority">High Priority First</option><option value="location">By Location</option></select>
      <div class="ftab">
        <button class="ftab-btn active" onclick="filterReportsByStatus2('',this)">All</button>
        <button class="ftab-btn" onclick="filterReportsByStatus2('pending',this)">Pending</button>
        <button class="ftab-btn" onclick="filterReportsByStatus2('validated',this)">Validated</button>
        <button class="ftab-btn" onclick="filterReportsByStatus2('incomplete',this)">Incomplete</button>
      </div>
    </div>
    <div style="padding:1rem 0;" id="reports-grid">
      <div class="report-grid" id="reports-container"></div>
    </div>
  </div>

  <!-- ══════════════════════════════════
       PAGE 3: WORK ORDERS
  ══════════════════════════════════ -->
  <div class="page" id="page-workorders">
    <div class="sh"><h2><i class="fas fa-clipboard-list"></i> Work Order Processing</h2><button class="btn btn-maroon btn-sm" onclick="openNewWorkOrder()"><i class="fas fa-plus"></i> Log Repair</button></div>
    <div class="fbar">
      <div class="sw"><i class="fas fa-search"></i><input class="si" type="text" placeholder="Search work orders..." oninput="filterWO(this.value)"/></div>
      <select class="fsel" onchange="filterWOStatus(this.value)"><option value="">All Status</option><option value="assigned">Assigned</option><option value="in_progress">In Progress</option><option value="completed">Completed</option></select>
      <select class="fsel"><option value="">All Priority</option><option value="critical">Critical</option><option value="high">High</option><option value="medium">Medium</option><option value="low">Low</option></select>
    </div>
    <div class="panel" style="margin-top:1rem;">
      <div style="overflow-x:auto;">
        <table class="tbl" id="wo-table">
          <thead><tr><th>Work Order ID</th><th>Equipment</th><th>Location</th><th>Issue</th><th>Priority</th><th>Status</th><th>Assigned</th><th>Actions</th></tr></thead>
          <tbody id="wo-tbody"></tbody>
        </table>
      </div>
    </div>
  </div>

  <!-- ══════════════════════════════════
       PAGE 4: MY TASKS
  ══════════════════════════════════ -->
  <div class="page" id="page-mytasks">
    <div class="sh"><h2><i class="fas fa-tasks"></i> My Tasks</h2><div style="display:flex;gap:.5rem;"><button class="btn btn-outline btn-sm" onclick="showPage('reports',null)"><i class="fas fa-plus"></i> Claim Task</button></div></div>
    <div class="fbar">
      <div class="sw"><i class="fas fa-search"></i><input class="si" type="text" placeholder="Search tasks..."/></div>
      <div class="ftab">
        <button class="ftab-btn active" onclick="filterMyTasks('all',this)">All</button>
        <button class="ftab-btn" onclick="filterMyTasks('in_progress',this)">In Progress</button>
        <button class="ftab-btn" onclick="filterMyTasks('assigned',this)">Assigned</button>
        <button class="ftab-btn" onclick="filterMyTasks('completed',this)">Completed</button>
      </div>
    </div>
    <div class="panel" style="margin-top:1rem;">
      <div style="overflow-x:auto;"><table class="tbl"><thead><tr><th>Task ID</th><th>Equipment</th><th>Location</th><th>Priority</th><th>Status</th><th>Timeline</th><th>Actions</th></tr></thead><tbody id="my-tasks-tbody"></tbody></table></div>
    </div>
  </div>

  <!-- ══════════════════════════════════
       PAGE 5: WORK HISTORY
  ══════════════════════════════════ -->
  <div class="page" id="page-history">
    <div class="sh"><h2><i class="fas fa-history"></i> Work History</h2><button class="btn btn-outline btn-sm"><i class="fas fa-download"></i> Export</button></div>
    <div class="fbar">
      <div class="sw"><i class="fas fa-search"></i><input class="si" type="text" placeholder="Search by equipment or date..."/></div>
      <select class="fsel"><option value="">All Status</option><option>Completed</option><option>Rejected</option><option>In-Progress</option></select>
      <input class="fsel" type="date" title="From date"/>
      <input class="fsel" type="date" title="To date"/>
    </div>
    <div class="panel" style="margin-top:1rem;">
      <div style="overflow-x:auto;"><table class="tbl"><thead><tr><th>Report ID</th><th>Equipment</th><th>Location</th><th>Priority</th><th>Completion Date</th><th>Status</th><th>Actions</th></tr></thead><tbody id="history-tbody"></tbody></table></div>
    </div>
  </div>

  <!-- ══════════════════════════════════
       PAGE 6: ANALYTICS
  ══════════════════════════════════ -->
  <div class="page" id="page-analytics">
    <div class="sh"><h2><i class="fas fa-chart-bar"></i> Performance Analytics</h2><div style="display:flex;gap:.5rem;"><select class="fsel">)<option>This Week</option><option>This Month</option><option>This Year</option></select></div></div>

    <!-- AI Summary -->
    <div class="ai-panel" style="margin-bottom:1.75rem;">
      <div class="ai-panel-inner">
        <div class="ai-icon"><i class="fas fa-brain"></i></div>
        <div class="ai-content">
          <h4>AI Performance Insights</h4>
          <p>Your completion rate improved <strong style="color:var(--gold-l);">+8%</strong> vs last week. You resolve <strong style="color:var(--gold-l);">Critical</strong> issues 40% faster than average. Consider prioritizing Building B — 3 overdue items. SLA compliance: <strong style="color:var(--gold-l);">94%</strong></p>
          <div class="ai-tags"><span class="ai-tag">↑ +8% Rate</span><span class="ai-tag">94% SLA</span><span class="ai-tag">Bldg B Alert</span><span class="ai-tag">Top Performer</span></div>
        </div>
      </div>
    </div>

    <!-- KPI Row -->
    <div class="stats-grid" style="margin-bottom:1.75rem;">
      <div class="sc s-d"><div class="sc-icon"><i class="fas fa-check-double"></i></div><div class="sc-num" data-target="48">48</div><div class="sc-lbl">Total Resolved</div><div class="sc-foot up"><i class="fas fa-arrow-up"></i> All time</div></div>
      <div class="sc s-p"><div class="sc-icon"><i class="fas fa-percentage"></i></div><div class="sc-num" data-target="94">94</div><div class="sc-lbl">SLA Compliance %</div><div class="sc-foot up"><i class="fas fa-arrow-up"></i> +2% this week</div></div>
      <div class="sc s-t"><div class="sc-icon"><i class="fas fa-hourglass-half"></i></div><div class="sc-num" data-target="3">3.2</div><div class="sc-lbl">Avg Days to Close</div><div class="sc-foot warn"><i class="fas fa-minus"></i> Industry avg: 4.1</div></div>
      <div class="sc s-i"><div class="sc-icon"><i class="fas fa-star"></i></div><div class="sc-num" data-target="92">92</div><div class="sc-lbl">Performance Score</div><div class="sc-foot up"><i class="fas fa-award"></i> Excellent</div></div>
    </div>

    <!-- Charts Row -->
    <div class="analytics-grid">
      <!-- Bar Chart Widget -->
      <div class="widget">
        <div class="widget-title"><i class="fas fa-chart-bar"></i> Tasks by Month (3D)</div>
        <div class="bar-chart" id="bar-chart"></div>
      </div>
      <!-- Donut Widget -->
      <div class="widget">
        <div class="widget-title"><i class="fas fa-chart-pie"></i> Task Status Breakdown</div>
        <div class="donut-wrap">
          <div class="donut">
            <svg width="100" height="100" viewBox="0 0 100 100">
              <circle cx="50" cy="50" r="38" fill="none" stroke="#EDE0CC" stroke-width="12"/>
