// ── NAVIGATION ────────────────────────────────────────────────────────────
const pageTitles = {
  dashboard:'Technician Dashboard', reports:'Incoming Reports Queue',
  workorders:'Work Order Processing', mytasks:'My Tasks',
  history:'Work History', analytics:'Performance Analytics',
  notifications:'Notification Center', profile:'Profile & Security'
};

function showPage(id, navEl) {
  document.querySelectorAll('.page').forEach(p => p.classList.remove('active'));
  document.getElementById('page-'+id).classList.add('active');
  document.querySelectorAll('.nav-item').forEach(n => n.classList.remove('active'));
  if(navEl) navEl.classList.add('active');
  else {
    document.querySelectorAll('.nav-item').forEach(n => {
      if(n.getAttribute('onclick') && n.getAttribute('onclick').includes("'"+id+"'")) n.classList.add('active');
    });
  }
  document.getElementById('tb-title').textContent = pageTitles[id] || id;
  document.getElementById('tb-crumb').textContent = pageTitles[id] || id;
  document.getElementById('sidebar').classList.remove('open');
  if(id==='reports') renderReports();
  if(id==='workorders') renderWO();
  if(id==='mytasks') renderMyTasks();
  if(id==='history') renderHistory();
  if(id==='analytics') renderBarChart();
  return false;
}

// ── DATE ──────────────────────────────────────────────────────────────────
const now = new Date();
document.getElementById('currentDate').textContent = now.toLocaleDateString('en-US',{weekday:'short',year:'numeric',month:'short',day:'numeric'});
document.getElementById('ai-date').textContent = now.toLocaleDateString('en-US',{month:'long',day:'numeric',year:'numeric'});

// ── COUNTERS ──────────────────────────────────────────────────────────────
document.querySelectorAll('.sc-num[data-target]').forEach(el => {
  const target = parseFloat(el.getAttribute('data-target'));
  let current = 0; const isFloat = target%1!==0;
  const step = Math.max(isFloat?0.1:1, target/30);
  const timer = setInterval(()=>{
    current = Math.min(current+step, target);
    el.textContent = isFloat ? current.toFixed(1) : Math.floor(current);
    if(current>=target) clearInterval(timer);
  }, 35);
});

// ── RENDER REPORTS ────────────────────────────────────────────────────────
let activeReports = [...reports];
function renderReports(list) {
  const data = list || activeReports;
  const container = document.getElementById('reports-container');
  if(!data.length){ container.innerHTML='<div class="empty"><i class="fas fa-inbox"></i><p>No reports found.</p></div>'; return; }
  const valMap = {ok:['b-validated','fa-check-circle','Validated'],warn:['b-warning','fa-exclamation-triangle','Needs Review'],err:['b-incomplete','fa-times-circle','Incomplete']};
  const priMap = {critical:'b-critical',high:'b-high',medium:'b-medium',low:'b-low'};
  container.innerHTML = data.map(r => `
    <div class="rcard" id="rcard-${r.id}">
      <div class="rcard-img" onclick="openPhotoModal('${r.id}','${r.equipment}')">
        <div class="rcard-img-placeholder"><i class="fas fa-image"></i></div>
        ${r.photos>0?`<div class="rcard-img-count"><i class="fas fa-camera"></i> ${r.photos}</div>`:''}
      </div>
      <div class="rcard-body">
        <div class="rcard-top"><span class="rcard-id">${r.id}</span><span class="badge ${priMap[r.priority]}">${r.priority}</span></div>
        <div class="rcard-title">${r.equipment}</div>
        <div class="rcard-meta">
          <span><i class="fas fa-tag"></i>${r.category}</span>
          <span><i class="fas fa-map-marker-alt"></i>${r.location}</span>
          <span><i class="fas fa-calendar"></i>${r.date}</span>
        </div>
        <div class="rcard-desc">${r.desc}</div>
        <div class="rcard-valid ${r.validation}">
          <i class="fas ${valMap[r.validation][1]}"></i> ${valMap[r.validation][2]}
          <div style="margin-left:auto;font-size:.65rem;opacity:.7;">
            ${r.validation==='ok'?'All fields complete':r.validation==='warn'?'Review required':'Missing fields'}
          </div>
        </div>
        <div class="rcard-actions">
          <button class="btn btn-outline btn-sm" onclick="openReportDetail('${r.id}')" style="flex:1;"><i class="fas fa-eye"></i> View</button>
          ${r.status!=='completed'?`<button class="btn btn-maroon btn-sm" onclick="claimReport('${r.id}')" style="flex:1;"><i class="fas fa-hand-paper"></i> Claim</button>`:''}
        </div>
      </div>
    </div>`).join('');
}

function filterReports(q) {
  activeReports = reports.filter(r =>
    r.equipment.toLowerCase().includes(q.toLowerCase()) ||
    r.id.toLowerCase().includes(q.toLowerCase()) ||
    r.location.toLowerCase().includes(q.toLowerCase())
  ); renderReports();
}
function filterReportsByPriority(v) {
  activeReports = v ? reports.filter(r=>r.priority===v) : [...reports]; renderReports();
}
function filterReportsByStatus(v) {
  activeReports = v ? reports.filter(r=>r.status===v||r.validation===v) : [...reports]; renderReports();
}
function filterReportsByStatus2(v, btn) {
  document.querySelectorAll('#page-reports .ftab-btn').forEach(b=>b.classList.remove('active'));
  btn.classList.add('active');
  activeReports = v ? reports.filter(r=>r.status===v||r.validation===v) : [...reports]; renderReports();
}
function sortReports(v) {
  if(v==='newest') activeReports.sort((a,b)=>b.date.localeCompare(a.date));
  else if(v==='priority') { const o={critical:0,high:1,medium:2,low:3}; activeReports.sort((a,b)=>o[a.priority]-o[b.priority]); }
  else if(v==='location') activeReports.sort((a,b)=>a.location.localeCompare(b.location));
  renderReports();
}

// ── RENDER WORK ORDERS ────────────────────────────────────────────────────
function renderWO(list) {
  const data = list || workOrders;
  const priMap = {critical:'b-critical',high:'b-high',medium:'b-medium',low:'b-low'};
  const stMap = {in_progress:'b-progress',assigned:'b-assigned',completed:'b-done'};
  const stLbl = {in_progress:'In Progress',assigned:'Assigned',completed:'Completed'};
  document.getElementById('wo-tbody').innerHTML = data.map(w=>`
    <tr id="wo-${w.id}">
      <td><span class="tbl-id">${w.id}</span></td>
      <td><div class="tbl-name">${w.equipment}</div></td>
      <td style="font-size:.78rem;color:var(--t3);">${w.location}</td>
      <td style="font-size:.78rem;color:var(--t2);max-width:180px;">${w.issue}</td>
      <td><span class="badge ${priMap[w.priority]}">${w.priority}</span></td>
      <td><span class="badge ${stMap[w.status]}">${stLbl[w.status]}</span></td>
      <td style="font-size:.75rem;color:var(--t3);">${w.date}</td>
      <td>
        <button class="act-btn" onclick="openWorkOrderModal('${w.id}')" title="View"><i class="fas fa-eye"></i></button>
        ${w.status!=='completed'?`<button class="act-btn" onclick="openRepairLog('${w.id}')" title="Log Repair"><i class="fas fa-wrench"></i></button>`:''}
        ${w.status==='in_progress'?`<button class="act-btn g" onclick="completeTask('${w.id}')" title="Complete"><i class="fas fa-check"></i></button>`:''}
      </td>
    </tr>`).join('');
}
function filterWO(q) {
  const d = workOrders.filter(w=>w.equipment.toLowerCase().includes(q.toLowerCase())||w.id.toLowerCase().includes(q.toLowerCase()));
  renderWO(d);
}
function filterWOStatus(v) {
  const d = v ? workOrders.filter(w=>w.status===v) : workOrders; renderWO(d);
}

