// ── BAR CHART ─────────────────────────────────────────────────────────────
function renderBarChart() {
  const months = [['Oct',6],['Nov',9],['Dec',7],['Jan',11],['Feb',8],['Mar',14]];
  const max = Math.max(...months.map(m=>m[1]));
  const colors = ['maroon','gold','blue','green','maroon','gold'];
  document.getElementById('bar-chart').innerHTML = months.map((m,i)=>`
    <div class="bar-wrap">
      <div class="bar-val">${m[1]}</div>
      <div class="bar ${colors[i]}" style="height:${(m[1]/max)*100}px;" title="${m[0]}: ${m[1]} tasks"></div>
      <div class="bar-lbl">${m[0]}</div>
    </div>`).join('');
}

// ── MODALS ────────────────────────────────────────────────────────────────
function openWorkOrderModal(id) {
  const all = [...workOrders,...myTasksData,...historyData];
  const t = all.find(x=>x.id===id);
  const r = reports.find(x=>x.id===id);
  const item = t||r||{};
  const priMap = {critical:'b-critical',high:'b-high',medium:'b-medium',low:'b-low'};
  const stMap = {in_progress:'b-progress',assigned:'b-assigned',completed:'b-done',pending:'b-pending',validated:'b-validated',incomplete:'b-incomplete'};
  document.getElementById('wo-modal-title').innerHTML = `<span style="color:var(--gold-l);margin-right:.4rem;font-size:.82rem;">${id}</span>${item.equipment||item.equipment||'Task Details'}`;
  document.getElementById('wo-modal-sub').textContent = `${(item.priority||'').toUpperCase()} Priority · ${item.location||''}`;
  document.getElementById('wo-modal-body').innerHTML = `
    <div class="dr2"><div class="dk2">Equipment</div><div class="dv2">${item.equipment||'—'}</div></div>
    <div class="dr2"><div class="dk2">Location</div><div class="dv2"><i class="fas fa-map-marker-alt" style="color:var(--maroon);margin-right:.3rem;"></i>${item.location||'—'}</div></div>
    ${item.priority?`<div class="dr2"><div class="dk2">Priority</div><div class="dv2"><span class="badge ${priMap[item.priority]}">${item.priority}</span></div></div>`:''}
    ${item.status?`<div class="dr2"><div class="dk2">Status</div><div class="dv2"><span class="badge ${stMap[item.status]||'b-pending'}">${item.status.replace('_',' ')}</span></div></div>`:''}
    ${item.date?`<div class="dr2"><div class="dk2">Date</div><div class="dv2">${item.date}</div></div>`:''}
    ${item.issue||item.desc?`<div class="dr2"><div class="dk2">Issue</div><div class="dv2">${item.issue||item.desc}</div></div>`:''}
    ${item.notes?`<div style="margin-top:1rem;padding:1rem;background:var(--db);border-radius:var(--r2);border:1px solid rgba(20,90,50,.2);"><div style="font-size:.62rem;font-weight:800;text-transform:uppercase;letter-spacing:.8px;color:var(--dc);margin-bottom:.4rem;"><i class="fas fa-wrench"></i> Repair Notes</div><p style="font-size:.83rem;color:var(--t1);">${item.notes}</p></div>`:''}
    <div class="tl" style="margin-top:1rem;">
      <div class="tls"><div class="tld done"><i class="fas fa-check"></i></div><div class="tlt"><strong>Report Submitted</strong><span>Defect report received by system</span></div></div>
      <div class="tls"><div class="tld ${['completed'].includes(item.status)?'done':'act'}"><i class="fas fa-${['completed'].includes(item.status)?'check':'wrench'}"></i></div><div class="tlt"><strong>Assigned to Technician</strong><span>${item.date||'—'}</span></div></div>
      <div class="tls"><div class="tld ${item.status==='completed'?'done':'idle'}"><i class="fas fa-${item.status==='completed'?'check':'clock'}"></i></div><div class="tlt"><strong>Work Completed</strong><span>${item.status==='completed'?'Verified by admin':'Pending'}</span></div></div>
    </div>`;
  const foot = document.getElementById('wo-modal-foot');
  foot.innerHTML = `<button class="btn btn-outline" onclick="closeModal('woModal')">Close</button>`;
  if(item.status==='assigned') foot.innerHTML+=`<button class="btn btn-maroon" onclick="startTask('${id}');closeModal('woModal')"><i class="fas fa-play"></i> Start Work</button>`;
  if(item.status==='in_progress') foot.innerHTML+=`<button class="btn btn-maroon" onclick="openRepairLog('${id}');closeModal('woModal')"><i class="fas fa-wrench"></i> Log Repair</button><button class="btn btn-success" onclick="completeTask('${id}');closeModal('woModal')"><i class="fas fa-check"></i> Mark Complete</button>`;
  document.getElementById('woModal').classList.add('open');
}

function openReportDetail(id) { openWorkOrderModal(id); }

function openRepairLog(id) {
  document.getElementById('rl-id').value = id;
  document.getElementById('repairModal').classList.add('open');
}
function submitRepairLog() {
  closeModal('repairModal');
  showToast('Repair Log Saved','Work order updated successfully.','ok');
}

function openNewWorkOrder() { openRepairLog('NEW'); }

function openPhotoModal(id, name) {
  document.getElementById('photo-modal-sub').textContent = name + ' — Photo Attachments';
  document.getElementById('photoModal').classList.add('open');
}

function closeModal(id) { document.getElementById(id).classList.remove('open'); }
document.querySelectorAll('.mo').forEach(o=>o.addEventListener('click',e=>{if(e.target===o)o.classList.remove('open')}));

// ── TASK ACTIONS ──────────────────────────────────────────────────────────
function claimReport(id) {
  const card = document.getElementById('rcard-'+id);
  if(card){ card.style.transition='all .4s ease'; card.style.opacity='0'; card.style.transform='scale(.9) translateY(-10px)'; setTimeout(()=>card.remove(),400); }
  showToast('Task Claimed — '+id,'Added to My Tasks. Start working!','ok');
}
function startTask(id) { showToast('Task Started — '+id,'Status updated to In Progress.',''); }
function completeTask(id) { showToast('Task Completed — '+id,'Submitted for admin verification!','ok'); }
function markAllRead() {
  document.querySelectorAll('.ni2.unread').forEach(n=>n.classList.remove('unread'));
  document.getElementById('nb-notif').textContent='0';
  document.getElementById('notif-pip').style.display='none';
  showToast('All Read','All notifications marked as read.','ok');
}

function confirmLogout() {
  document.getElementById('confirm-icon').textContent='👋';
  document.getElementById('confirm-title').textContent='Logout';
  document.getElementById('confirm-msg').textContent='Are you sure you want to log out of the BEC Technician Portal?';
  document.getElementById('confirm-ok-btn').onclick=()=>{ closeModal('confirmModal'); showToast('Logged out','Redirecting to login...',''); };
  document.getElementById('confirmModal').classList.add('open');
}

// ── TOAST ─────────────────────────────────────────────────────────────────
function showToast(title,sub,type){
  const tray=document.getElementById('ttray');
  const t=document.createElement('div');
  t.className=`toast ${type}`;
  const icons={ok:'fa-check-circle',err:'fa-times-circle',warn:'fa-exclamation-triangle','':'fa-info-circle'};
  t.innerHTML=`<i class="t-ic fas ${icons[type]||'fa-info-circle'}"></i><div><div class="t-txt">${title}</div><div class="t-sub">${sub}</div></div>`;
  tray.appendChild(t);
  setTimeout(()=>t.classList.add('show'),20);
  setTimeout(()=>{t.classList.remove('show');setTimeout(()=>t.remove(),400);},3800);
}

// ── INIT ──────────────────────────────────────────────────────────────────
renderReports();
renderWO();
renderMyTasks();
renderHistory();
renderBarChart();
</script>
